u00c1RIA", "\u003cp align=\"\"justify\"\"\u003eEXECU\u00c7\u00c3O DE OBRAS NAS AREAS 3 E 4 NOS C\u00c2NIOS DE CAPITOLIO/MG - ESTABILIZA\u00c7\u00c3O DE TALUDES ROCHOSOS.\u003c/p\u003e\u003cp align=\"\"justify\"\"\u003e\u003cbr /\u003e\u003c/p\u003e\u003cp align=\"\"justify\"\"\u003eJustifica-se como crit\u00e9rio de escolha das \u00e1reas 3 e 4, cujas coordenadas s\u00e3o 20\u00b038\u0026#39;47.98\u0026#34;S 46\u00b015\u0026#39;59.05\u0026#34;O e 20\u00b038\u0026#39;47.00\u0026#34;S 46\u00b015\u0026#39;57.77\u0026#34;O, respectivamente, em detrimento das demais \u00e1reas que abrangem as \u00e1reas cr\u00edticas, definida pelos documentos t\u00e9cnicos acostados ao expediente, porque as mesmas est\u00e3o situadas no local de maior risco, onde a visita\u00e7\u00e3o est\u00e1 temporariamente proibida. Este maior risco \u00e9 oriundo n\u00e3o apenas da condi\u00e7\u00e3o potencial de instabilidade (o que ocorre em outros pontos tamb\u00e9m), mas sim com o elevado risco de atingimento aos visitantes. Sendo o risco o produto entre a possibilidade de ocorr\u00eancia da instabilidade pelo dano causado por elas, as \u00e1reas 3 e 4 foram elencadas pela equipe t\u00e9cnica como dentre as de maior risco, j\u00e1 que no modelo atual de visita\u00e7\u00e3o esse local \u00e9 onde as embarca\u00e7\u00f5es imprimem a menor velocidade no passeio, o que aumenta o tempo de exposi\u00e7\u00e3o das pessoas ao risco. As \u00e1reas 1 e 2, apesar de estarem na entrada dos Canyons, est\u00e3o em locais onde as embarca\u00e7\u00f5es passam em movimento constante, com facilidade para deslocamento mais r\u00e1pido caso seja percebido qualquer ind\u00edcio de perigo, ao contr\u00e1rio das 3 e 4, onde a embarca\u00e7\u00e3o imprime as menores velocidades e fazem a manobra para retornar \u00e0 sa\u00edda dos canyons. Com a estabiliza\u00e7\u00e3o feita atrav\u00e9s da obra nesses 2 locais, poder\u00e1 ser realizado modifica\u00e7\u00e3o na forma de visita\u00e7\u00e3o atual, possibilitando assim a abertura de uma \u00e1rea maior para visita\u00e7\u00e3o, al\u00e9m de ser esta \u00e1rea a mais visitada nos c\u00e2nions. Essa modifica\u00e7\u00e3o far\u00e1 com que o passeio contemplativo possa se estabelecer de forma mais completa e que trazer mais impacto na mitiga\u00e7\u00e3o do risco do passeio pelo turista, consequentemente trazendo mais turistas para o munic\u00edpio e regi\u00e3o.\u00a0\u003c/p\u003e\u003cp\u003e\u003cbr /\u003e\u003c/p\u003e"], "code": "foreign-key-error", "description": "Values in the foreign key fields should exist in the reference table", "message": "Row at position \"46052\" violates the foreign key: for \"id_convenio\": values \"68530\" not found in the lookup table \"dm_convenio\" as \"id_convenio\"", "name": "ForeignKey Error", "note": "for \"id_convenio\": values \"68530\" not found in the lookup table \"dm_convenio\" as \"id_convenio\"", "rowNumber": 46051, "rowPosition": 46052, "tags": ["#table", "#row"]}, {"cells": ["68542", "01/AS", "", "ALTERA\u00c7\u00c3O SIMPLES", "\u003cp\u003eO presente projeto visa promover um grande festival cultural na semana da crian\u00e7a denominado ?SEMANA DA CRIAN\u00c7A?, com apresenta\u00e7\u00f5es art\u00edsticas na \u00e1rea\u003c/p\u003e\u003cp\u003eda m\u00fasica, do teatro e da dan\u00e7a, a fim de despertar talentos, promover entretenimento e fomentar a cultura de nosso munic\u00edpio. Ser\u00e3o tr\u00eas dias de evento com\u003c/p\u003e\u003cp\u003eapresenta\u00e7\u00f5es dos alunos do Programa Arte Viva, com o Festival de M\u00fasica Som do Cerrado e o Festival de M\u00fasica Estudantil. Ainda, contar\u00e1 com uma pra\u00e7a de\u003c/p\u003e\u003cp\u003ealimenta\u00e7\u00e3o da gastronomia local, contemplando assim \u00e1reas culturais integradas. Neste festival estimamos um p\u00fablico de 8.000 pessoas.\u003c/p\u003e\u003cp\u003eDescri\u00e7\u00e3o\u003c/p\u003e\u003cp\u003eExplicativo\u003c/p\u003e\u003cp\u003ePrograma Arte Viva: Programa inserido na Secretaria de Cultura e Turismo de Patroc\u00ednio que visa oferecer, facilitar e qualificar a frui\u00e7\u00e3o art\u00edstica pelo p\u00fablico\u003c/p\u003e\u003cp\u003ebeneficiado, nas modalidades dan\u00e7a (bal\u00e9, jazz, hiphop, dan\u00e7a de sal\u00e3o), artesanato (pintura em tecido, pintura em tela, tric\u00f4 e croch\u00ea, recicl\u00e1veis), m\u00fasica (flauta,\u003c/p\u003e\u003cp\u003eviol\u00e3o, violino, percuss\u00e3o, coral e musicaliza\u00e7\u00e3o), teatro e capoeira. O Programa n\u00e3o possui uma sede pr\u00f3pria, a execu\u00e7\u00e3o dos cursos \u00e9 realizada de forma pr\u00e1tica\u003c/p\u003e\u003cp\u003epor professores plenamente capacitados que v\u00e3o ao encontro de seus alunos (crian\u00e7as e adolescentes) nas intui\u00e7\u00f5es filantr\u00f3picas, escolas municipais e estaduais,\u003c/p\u003e\u003cp\u003ecentros de educa\u00e7\u00e3o infantil, entidades em geral. Assim ser\u00e3o realizadas apresenta\u00e7\u00f5es dos alunos do Programa para mostrar os resultados alcan\u00e7ados para as\u003c/p\u003e\u003cp\u003esuas fam\u00edlias e toda a comunidade. (Tr\u00eas noites, aprox. 40 min de apresenta\u00e7\u00e3o).\u003c/p\u003e\u003cp\u003eFestival de M\u00fasica Som do Cerrado: Festival que consiste em uma disputa t\u00e9cnica de bandas/duplas/solos, em todas as faixas et\u00e1rias, com voto de uma bancada\u003c/p\u003e\u003cp\u003ede jurados, para os artistas regionais nos estilos MPB, Sertanejo, Rap, Rock, Pop e Gospel. O qual procura desenvolver o resgate social, e exercer a cidadania\u003c/p\u003e\u003cp\u003eatrav\u00e9s de a\u00e7\u00f5es concretas e participativas. (Este ser\u00e1 realizado tamb\u00e9m todas as noites, ap\u00f3s as apresenta\u00e7\u00f5es do Programa Arte Viva, aprox. 2 horas de\u003c/p\u003e\u003cp\u003edura\u00e7\u00e3o, ir\u00e1 depender da quantidade de inscri\u00e7\u00f5es).\u003c/p\u003e\u003cp\u003eFestival de M\u00fasica - E: Festival de M\u00fasica Estudantil que tem como objetivo incentivar a cultura musical de todas as escolas de Patroc\u00ednio de esferas municipais,\u003c/p\u003e\u003cp\u003eestaduais e particulares. Disputa de bandas/duplas/solos, estilo musical livre, desde que n\u00e3o fa\u00e7a apologia a sexo, drogas e viol\u00eancia, buscando assim evidenciar e\u003c/p\u003e\u003cp\u003evalorizar novos talentos. (Ser\u00e1 realizado no domingo a tarde, aprox. 2 horas de dura\u00e7\u00e3o, ir\u00e1 depender da quantidade de inscri\u00e7\u00f5es).\u003c/p\u003e\u003cp\u003eSuposto Cronograma\u003c/p\u003e\u003cp\u003eSEMANA DA CRIAN\u00c7A\u003c/p\u003e\u003cp\u003eSexta-feira (noite):\u003c/p\u003e\u003cp\u003eMusical do Programa Arte Viva (?A era de Beethoven? )\u003c/p\u003e\u003cp\u003eFestival de M\u00fasica Som do Cerrado nas modalidades SERTANEJO e GOSPEL.\u003c/p\u003e\u003cp\u003eS\u00e1bado (tarde noite):\u003c/p\u003e\u003cp\u003eFestival de M\u00fasica E ? Estudantil\u003c/p\u003e\u003cp\u003eApresenta\u00e7\u00e3o dos Centros de Educa\u00e7\u00e3o Infantil do Programa Arte Viva (Musical Infantil ?A Arca de No\u00e9?)\u003c/p\u003e\u003cp\u003eFestival de M\u00fasica Som do Cerrado nas modalidades MPB E e POP/ROCK.\u003c/p\u003e\u003cp\u003eDomingo (noite):\u003c/p\u003e\u003cp\u003eApresenta\u00e7\u00e3o de Dan\u00e7a do Programa Arte Viva (Hist\u00f3ria da Arte com o espet\u00e1culo ?Tela Viva?)\u003c/p\u003e\u003cp\u003eFestival de M\u00fasica Som do Cerrado nas modalidades PAGODE e RAP\u003c/p\u003e\u003cp\u003eO festival ter\u00e1 tr\u00eas dias de dura\u00e7\u00e3o, sendo sexta, s\u00e1bado e domingo. Ser\u00e1 realizado em pra\u00e7a p\u00fablica, na Esplanada do Museu Hist\u00f3rico onde conta com um\u003c/p\u003e\u003cp\u003eespa\u00e7o amplo. Assim, ser\u00e1 montada uma grande estrutura para as apresenta\u00e7\u00f5es art\u00edsticas bem como para a pra\u00e7a de alimenta\u00e7\u00e3o (palco e tendas). A estrutura \u00e9\u003c/p\u003e\u003cp\u003esempre montada um dia antes, para o ensaio geral dos alunos do Programa Arte Viva. A que se resguardar da qu <script>

document.addEventListener("DOMContentLoaded", function () {
  const content = document.querySelector("#livemark-main");
  const headings = content.querySelectorAll("h1, h2, h3, h4, h5, h6, h7");
  const headingMap = {};

  // Add identifiers
  Array.prototype.forEach.call(headings, function (heading) {
    const id = heading.id
      ? heading.id
      : heading.textContent
          .trim()
          .toLowerCase()
          .split(" ")
          .join("-")
          .replace(/[!@#$%^&*():]/gi, "")
          .replace(/\//gi, "-");
    headingMap[id] = !isNaN(headingMap[id]) ? ++headingMap[id] : 0;
    if (headingMap[id]) {
      heading.id = id + "-" + headingMap[id];
    } else {
      heading.id = id;
    }
  });

  // Add links
  Array.prototype.forEach.call(headings, function (heading) {
    const link = document.createElement("a");
    link.href = "#" + heading.id;
    link.innerText = "#";
    link.classList.add("heading");
    heading.appendChild(link);
  });
});

</script>

  $("#livemark-topics .toc ul.is-collapsible li").addClass("secondary");
  $("#livemark-topics .toc ul.is-collapsible li > a").addClass("secondary");
  for (const element of $("#livemark-topics .primary")) {
    if ($(element).find(".secondary").length) {
      $(element).addClass("group");

  // Sync list
  function syncList() {
    for (const element of $("#livemark-topics li.primary")) {
      if ($(element).find(".is-active-li").length) {
        $(element).addClass("is-active-li");
      }
    }
  }
  syncList();
});

</script>

<script>

document.addEventListener("DOMContentLoaded", function () {
  const container = $(".livemark-infinity");
  if (container.length) {
    const elements = container
      .children()
      .map((index, element) => element.outerHTML)
      .get();
    container.html(elements.splice(0, 100));
    container.show();
    window.addEventListener("scroll", () => {
      const element = container.get(0);
      const position = window.scrollY + window.innerHeight + 100;
      const threshold = element.offsetTop + element.scrollHeight;
      if (position > threshold) {
        container.append(elements.splice(0, 100));
      }
    });
  }
});

</script>

<script>

document.addEventListener("DOMContentLoaded", function () {
  // Add buttons
  $("h2").append('<a href="" class="livemark-source-button">Source</a>');

  // Enable buttons
  $(".livemark-source-button").click(async (ev) => {
    ev.preventDefault();

    // Close open
    if ($(".livemark-source-section").length) {
      $(".livemark-source-section").remove();
      return;
    }

    // Load content
    let source = location.href.replace(".html", ".md");
    if (!source.endsWith(".md")) source = `${source}index.md`;
    const heading = $(ev.target).parent().contents().get(0).nodeValue;
    response = await fetch(source);
    content = await response.text();

    // Extract section
    let isCapture;
    const lines = [];
    for (const line of content.split(/\r?\n/)) {
      if (line.startsWith("##")) {
        isCapture = line.startsWith(`## ${heading}`) ? true : false;
        continue;
      }
      if (isCapture) {
        lines.push(line);
      }
    }
    const section = _.escape(lines.join("\n").trim());

    // Show section
    $(ev.target)
      .parent()
      .after(
        `<pre class="livemark-source-section" style="white-space: pre-wrap;">${section}</pre>`
      );
  });
});

</script>
